// import './Expenses.css';

function Expenses(props) {
  return (
    <div className='bg-black p-3 w75'>
{    props.items.map(item=>{
        return <ExpenseItem
            title={item.title}
            amount={item.amount}
            date={item.date}
          />
    })}
  </div>
  );

}

export default Expenses;
